### 这个函数，主要是生成新的模型所用的原始数据集的（训练、测试及验证数据集）  主要是让生成的这批数据他们的阴性与阳性的比例能够更改一下，变成1:1，与1:2
def Ceshi_Two():
    path = 'D:\\DailyCode\\P-Net\\CodeModel\\(Father)pnet_prostate_paper-published_to_zenodo\\pnet_prostate_paper-published_to_zenodo\\_database\\prostate\\splits\\'
    file1, file2, file3 = 'validation_set.csv', 'test_set.csv', 'training_set.csv'
    data1 = pd.read_csv(path + file1).values
    data2 = pd.read_csv(path + file2).values
    data3 = pd.read_csv(path + file3).values
    data1List, data2List, data3List = list(data1), list(data2), list(data3)
    data1List.extend(data2List)
    data1List.extend(data3List)
    data = data1List


    ## 下面在打乱数据后，开始删除阴性样本 一共删除665-348=317个   在这样本中，阳性的有348个，阴性的有665个
    random.shuffle(data)
    PosNum, NegNum = 0, 0
    for ele in data:
        if ele[2] == 0:
            NegNum = NegNum +1
        else:
            PosNum = PosNum + 1

    DelNum = NegNum - PosNum                           ## 因为不同的数据文件中，他的阳性样本以及阴性样本的数目可能都不太相同！   现在这句话就是来构造的数据的正负样本是均衡的状态
    DelNum = NegNum - PosNum + int(PosNum*0.5)         ## 因为不同的数据文件中，他的阳性样本以及阴性样本的数目可能都不太相同！   现在就是让新构造的数据集中，阳性样本的数目是阴性的二倍！
    print("目前经过分析可得，这个数据集中的，正样本、负样本、要删除1样本的情况是！", PosNum, NegNum, DelNum)
    ProcessData_Pos, ProcessData_Neg = [], []

    for ele in data:
        if DelNum > 0 and ele[2] == 0:     ### 如果这一项是阴性，并且当前还是需要删除的
            DelNum = DelNum - 1
        elif ele[2] == 0:                ### 这一项是阴性，而且现在不需要删除了！
            ProcessData_Neg.append(ele[1:3])   ## 截取后两项内容
        else:
            ProcessData_Pos.append(ele[1:3])  ## 截取后两项内容
    print("那么经过截取之后的这个数据的情况是怎样的！", len(ProcessData_Pos) == len(ProcessData_Neg), len(ProcessData_Pos), len(ProcessData_Neg))


    ##------ 现在这两批数据已经划分好了，开始随机的抽取一部分数据做训练、验证和测试
    TestNumNeg, ValidNumNeg = int(len(ProcessData_Neg)*0.1), int(len(ProcessData_Neg)*0.1)
    TrainNumNeg = len(ProcessData_Neg) - TestNumNeg - ValidNumNeg      ###  现在这个是来获取阴性数据集中的训练、测试、验证的数据的数目

    TestNumPos, ValidNumPos = int(len(ProcessData_Pos)*0.1), int(len(ProcessData_Pos)*0.1)
    TrainNumPos = len(ProcessData_Pos) - TestNumPos - ValidNumPos      ###  现在这个是来获取阳性数据集中的训练、测试、验证的数据的数目

    def GetTrainValitTest(ProcessData_Neg, ProcessData_Pos, TestNumNeg, TestNumPos, fileName):
        # 获取一个元素在一个数组当中的下标位置   因为这个数组是二维数组，而这个元素也是一个数组的形式，因此不能直接调用函数来进行删除或者或取下标，只能手动来做   下面这个函数的意义在于在抽取完样本之后，要把这个样本从原数组中进行删除！
        def GetIndex(ProcessData_Neg, target):
            Index = []      ## 最后符合条件的元素可能有多个，因此用一个列表存放多个元素
            # print("此时的这个数据的元素情况是怎样的！", target, type(target))
            # print("这个数组的情况是怎样的！", type(ProcessData_Neg[0]), ProcessData_Neg)
            for i in range(len(ProcessData_Neg)):
                if ProcessData_Neg[i].any() == target.any():
                    Index.append(i)
            return Index

        # 随机抽取一定比例的元素样本   阴性
        Test_Neg = random.sample(ProcessData_Neg, TestNumNeg)
        # 从原数组中删除抽取的这些元素  阴性
        for elem in Test_Neg:
            Index = GetIndex(ProcessData_Neg, elem)      ### 此时获取的是一个索引列表  获取那些样本在原数组中的下标位置
            if len(Index) > 1:
                print("报错！按理说重复的元素只能有1个，而现在重复的元素数目为！", len(Index), elem)
            for i in Index:
                # print("目前要删除的这个元素的下标情况是怎样的！", i, len(ProcessData_Neg))
                ProcessData_Neg.pop(i)

        # 随机抽取一定比例的元素样本   阳性
        Test_Pos = random.sample(ProcessData_Pos, TestNumPos)       ## 这个也就决定着按照一定的比例来进行抽取元素！
        # 从原数组中删除抽取的这些元素  阳性
        for elem in Test_Pos:
            Index = GetIndex(ProcessData_Pos, elem)      ### 此时获取的是一个索引列表  获取那些样本在原数组中的下标位置
            if len(Index) > 1:
                print("报错！按理说重复的元素只能有1个，而现在重复的元素数目为！", len(Index))
            for i in Index:
                ProcessData_Pos.pop(i)

        ## 之后，再将抽取的这两组元素进行合并
        Test_Neg_List, Test_Pos_List = list(Test_Neg), list(Test_Pos)
        print("此时阳性样本的数据情况是怎样的！", len(Test_Pos_List), Test_Pos_List)
        Test_Neg_List.extend(Test_Pos_List)
        TestData = Test_Neg_List
        random.shuffle(TestData)

        TestData = np.array(TestData)           ### 这个把列表转化为数组的这步转化


        # ## 下面这部分代码就是来测试的，看看当前这个分割对不对！
        # ceshiNumNeg, ceshiNumPos = 0, 0
        # for ele in TestData:
        #     if ele[1] == 0:
        #         ceshiNumNeg = ceshiNumNeg + 1
        #     else:
        #         ceshiNumPos = ceshiNumPos + 1
        # print("测试完之后，这个数据的情况是怎样的！", ceshiNumNeg == ceshiNumPos, ceshiNumNeg, ceshiNumPos)

        print("那么打乱之后的这个数据的情况是怎样的！", len(TestData), TestData)

        # TempData = []
        # for flag in range(len(TestData)):
        #     TempData.append(np.insert(TestData[flag], 0, flag))
        # TempData = np.array(TempData)
        #
        # print("那么打乱之后的这个数据的情况是怎样的！", len(TempData), TempData)

        ### 现在这个处理后的数据已经获取到了，现在在就是将这个数据进行保存！
        df = pd.DataFrame(TestData)
        # df.to_csv('./OtherTest/OriData/PosNeg1B1/' + fileName)      ### 阳性与阴性，1:1均衡时的情况
        df.to_csv('./OtherTest/OriData/PosNeg2B1/' + fileName)     ### 阳性与阴性，2:1均衡时的情况
        return ProcessData_Neg, ProcessData_Pos

    fileName = 'test_set.csv'
    ProcessData_Neg, ProcessData_Pos = GetTrainValitTest(ProcessData_Neg, ProcessData_Pos, TestNumNeg, TestNumPos, fileName)
    print("此时是提取完测试数据后的这个原始数据的长度", len(ProcessData_Neg), len(ProcessData_Pos))
    fileName = 'validation_set.csv'
    ProcessData_Neg, ProcessData_Pos = GetTrainValitTest(ProcessData_Neg, ProcessData_Pos, ValidNumNeg, ValidNumPos, fileName)
    print("此时是提取完测试以及验证数据后的这个原始数据的长度", len(ProcessData_Neg), len(ProcessData_Pos))
    fileName = 'training_set_0.csv'
    ProcessData_Neg, ProcessData_Pos = GetTrainValitTest(ProcessData_Neg, ProcessData_Pos, TrainNumNeg, TrainNumPos, fileName)
    print("此时是提取完测试以及验证以及训练数据后的这个原始数据的长度", len(ProcessData_Neg), len(ProcessData_Pos))




