    ### 下述函数即为得到 基因/通路的相关性
    def GetCorr(data, GSEAGene):
        ## 1. 先读取项目所用的基因数据    在这的这个基因名称数据必须是严格按照网络层所指定的神经元节点所排列的！
        print("当前的这组数据的长度为！", len(data))
        Gene = []
        for ele in data:
            Gene.append(ele)             ### 现在获取了各层的基因/通路的名字   前提在于这个基因/通路一定是按照基因/通路层的神经元节点的顺序排列的



        ## 2. 读取并处理富集分数 基因分数结果
        GSEAGene = np.array(GSEAGene)
        # print("现在，原始的这个基因情况是怎样的！", GSEAGene)
        GSGene, GSGeneData, GSGeneScore = [], {}, []          ### 现在来求出各个基因/通路的GSEA分数   现在读进来的GSEAGene只有两列，分别是名字和GSEA分数
        for ele in GSEAGene:
            GSGene.append(ele[0])
            GSGeneData[ele[0]] = ele[1]

        ## 3. 处理两个基因列表中的交集数据(保持基因数据的出现顺序与源代码一致)
        OriGeneScore, GeneNameList = [], []              ### 最终的原始基因分数还是专门的再重新的弄个列表来进行存储！毕竟有200-300各基因只在项目中而并未在GSEA中

        FinalGSGeneDict, ErrorDict = {}, {}               ### 这个是最终所选定的那些基因数据所存放的字典（因为最终的这些基因数据是要用原始基因数据与GSEA数据之间取交集的！）     这个ErrorDict就是指当一个基因找不到对应的GSEA值时，便随机产生了一个！
        for ele in Gene:
            if ele in GSGene:      ## 说明此时当前这个基因能够找到对应的GSEA分数值了！
                GSGeneScore.append(GSGeneData[ele])
                GeneNameList.append(ele)
                FinalGSGeneDict[ele] = GSGeneData[ele]



        ## 下面来对两组数据列表进行求归一化操作！
        def map(data, MIN, MAX):
            """
            归一化映射到任意区间
            :param data: 数据
            :param MIN: 目标数据最小值
            :param MAX: 目标数据最小值
            :return:
            """
            d_min = np.min(data)  # 当前数据最大值
            d_max = np.max(data)  # 当前数据最小值
            return MIN + ((MAX - MIN) / (d_max - d_min)) * (data - d_min)

        print("测试一下，当前的这个基因数据是怎样的！", len(GSGeneScore))
        # NorGSGeneScore = map(GSGeneScore, 0, 0.1)              #### 这个是归一化后的GSEA数据        在这是可以自行指定最终数据归一化到的范围！
        NorGSGeneScore = GSGeneScore            ### 在这不再进行归一化操作     直接取原始的数值    这句话的意思：如果这句话不被注释的话，那么就需要将上一句话给注释了！他表示不进行归一化，直接取原始数据值！

        TempGSEADict = {}
        for i in range(len(GeneNameList)):
            TempGSEADict[GeneNameList[i]] = NorGSGeneScore[i]

        ### 在获取归一化的GSEA数据之后，需要想办法将那些没找到对应GSEA数据的基因/通路随机产生一个（-1，1）之间的一个数据        不能在归一化之前产生，之前的数据没有进行归一化，他的范围还不是（-1，1）
        FinalGeneScore, FinalGeneName = [], []
        for i in range(len(Gene)):
            if Gene[i] in GeneNameList:
                FinalGeneScore.append(TempGSEADict[Gene[i]])
                FinalGeneName.append(Gene[i])
            else:                      #### 此时就说明当前的这个基因并没有找到对应的GSEA分数
                randomScore = np.random.uniform(0, 1)  ### 找不到GSEA值的，那就随机产生一个随机数
                randomScore = 0                    #### 正常情况下是没有这句话的，这个是在于将那些没找到对应项的那些元素他们的GSEA值设置为0     因为现在是想让GSEA数值与原始模型的数值进行相加的，在这没有GSEA数值就认为就是0         在这，未知项到底是填谁是通过这句话在这取的！
                FinalGeneScore.append(randomScore)
                FinalGeneName.append(Gene[i])

                ErrorDict[Gene[i]] = randomScore

        print("此时这个循环走完没！没有对应上的基因数目有多少个！", len(ErrorDict))
        print("那么当前所求出来的当前层的这个基因/通路的名字为：", len(FinalGeneName), FinalGeneName)
        print("那么当前所求出来的当前层的这个基因/通路的分数为：", len(FinalGeneScore), FinalGeneScore)

        ### 不过现在风向变了，需要返回一个基因名字与对应的GSEA分数的对照表！（之所以要实现这个，是因为每次运行，网络架构中的各个生物学含义的神经元的位置都是在不断地发生变化的！要根据神经元新的位置来读取各个对应的GSEA分数！）
        FinalGSEADict = {}
        for i in range(len(FinalGeneName)):
            FinalGSEADict[FinalGeneName[i]] = FinalGeneScore[i]        ### 求取各个基因位置处所对应的GSEA分数值！
        print("最终所获取的各个基因/通路所对应的这个GSEA分数情况字典为：", len(FinalGSEADict), FinalGSEADict)


